funcLogin:
function funcLogin() {
  log("funcLogin");

  const tag = localStorage.getItem("TZ_LOGIN");
  if (tag && new Date().getTime() - tag < 1000 * 10) return;
  localStorage.setItem("TZ_LOGIN", new Date().getTime());

    
  logParam.sub_type = "login";
  message: "start login";
  TZLOG(logParam, (data) => {}); 
  txtId.value = "${login_id}";
  txtPw.value = "${login_password}";
  doLogin();
 
}

